// 发送数据包的底层函数
// 格式: [0xA5] [Type] [LenL] [LenH] [Data...]
void Send_Packet(uint8 type, uint8* data_t, uint16 len)
{
    uint8 header[4];
    header[0] = 0xA5;       // 包头
    header[1] = type;       // 类型
    header[2] = (len >> 8) & 0xFF; // 长度高8位 (大端序发送，配合Java DataInputStream readShort)
    header[3] = len & 0xFF;        // 长度低8
    // 1. 先发头
    wifi_spi_send_buffer(header, 4);
    // 2. 再发数据
    wifi_spi_send_buffer(data_t, len);
}
void Send_Text(char* str)
{
    Send_Packet(0x01, (uint8*)str, strlen(str));
}
void Send_Image(uint8* image_data,uint8 type)
{
    // 80 * 60 * 2 = 9600 bytes
	if(type==0)
		Send_Packet(0x02, image_data, 94*60);
	else if(type==1)
		Send_Packet(0x02, image_data, 9600);
}